import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Profile from './components/Profile';

function App() {
  return (
    <Router>
      <Routes>
        {/* <Route path="/" exact component={Profile} /> */}
        <Route path="/awards" element={<Profile />} />

      </Routes>
    </Router>
  );
}

export default App;
